import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: '123'
        },
        {
          name: 'Frank'

        },
        {
          name: 'Jacky'
        },
        {
          name: 'Andrei'
        }
      ]
    };
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map((monster)=>{
            return <h1 key={monster.name}>{monster.name}</h1>
            // key is the unique value and when we have many records name is not 
            // going to be unique


          })
        }
       </div>
    );
  }

}

export default App;
